import React from 'react'
import * as ReactBootStrap from 'react-bootstrap';

export default function Services() {
    return (
        <ReactBootStrap.Container className="s-container">
            <div className="s-header">
                <h1></h1>
            </div>
            <ReactBootStrap.Row  className="text-center">
                <ReactBootStrap.Col md={4}>md=4</ReactBootStrap.Col>
                <ReactBootStrap.Col md={{ span: 4, offset: 4 }}>{`md={{ span: 4, offset: 4 }}`}</ReactBootStrap.Col>
            </ReactBootStrap.Row>
        </ReactBootStrap.Container>
    )
}
